import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';

const Dashboard = () => {
  const [designs, setDesigns] = useState([]);
  const [loading, setLoading] = useState(true);
  const navigate = useNavigate();

  useEffect(() => {
    const token = localStorage.getItem('token') || 'YOUR_JWT_TOKEN';
    fetch('http://localhost:5000/api/designs', {
      headers: {
        'Authorization': `Bearer ${token}`,
      },
    })
      .then((res) => res.json())
      .then((data) => {
        if (Array.isArray(data)) setDesigns(data);
        else if (data.designs && Array.isArray(data.designs)) setDesigns(data.designs);
        else setDesigns([]);
        setLoading(false);
      })
      .catch(() => setLoading(false));
  }, []);

  const visibleDesigns = designs.slice(0, 8);

  // Navigate to editor for new design
  const handleAddNew = () => navigate('/editor');

  // Navigate to editor with design id for existing design
  const openDesign = (id) => navigate(`/editor/${id}`);

  return (
    <div className="min-h-screen bg-gray-100">
      {/* Header */}
      <header className="flex justify-between items-center px-8 py-4 bg-white shadow">
        <div className="text-2xl font-extrabold text-indigo-700 cursor-pointer" onClick={() => navigate('/')}>
          Matty
        </div>
        <div className="flex gap-4">
          <a href="#" className="w-6 h-6 bg-blue-500 rounded-full" />
          <a href="#" className="w-6 h-6 bg-pink-500 rounded-full" />
          <a href="#" className="w-6 h-6 bg-yellow-400 rounded-full" />
        </div>
        <button className="px-4 py-1 rounded bg-indigo-600 text-white">About Us</button>
      </header>

      {/* Banner */}
      <section
        className="relative mt-5 mx-8 rounded-xl h-40 flex items-center overflow-hidden"
        style={{
          background:
            "url('https://images.unsplash.com/photo-1465101162946-4377e57745c3?auto=format&fit=cover&w=800&q=80') center/cover",
        }}
      >
        <div className="bg-black bg-opacity-50 absolute inset-0" />
        <h1 className="relative z-10 text-4xl font-bold text-white mx-auto">Projects</h1>
      </section>

      {/* Controls & sorting */}
      <div className="flex flex-wrap justify-between items-center my-8 mx-8">
        <h2 className="text-2xl font-semibold">Recent designs</h2>
        <div className="flex gap-3 items-center">
          <label htmlFor="sort" className="text-gray-600 mr-1">
            Sort by:
          </label>
          <select
            id="sort"
            className="bg-white border px-2 py-1 rounded"
            onChange={(e) => {
              // Optional sort implementation
            }}
          >
            <option>Date Created</option>
            <option>Title</option>
          </select>
          <button
            className="ml-4 px-4 py-2 rounded bg-indigo-600 text-white font-semibold shadow hover:bg-indigo-700"
            onClick={handleAddNew}
          >
            + Add New Design
          </button>
        </div>
      </div>

      {/* Design cards */}
      <div className="mx-8">
        {loading ? (
          <div className="py-20 text-center text-gray-500">Loading designs...</div>
        ) : designs.length === 0 ? (
          <div className="py-20 text-center text-gray-400">No designs found.</div>
        ) : (
          <div className="grid grid-cols-2 md:grid-cols-4 gap-6">
            {visibleDesigns.map((design) => (
              <div
                key={design._id}
                className="bg-white rounded-xl shadow p-3 flex flex-col items-center hover:cursor-pointer hover:shadow-lg"
                onClick={() => openDesign(design._id)}
                title="Click to open editor"
              >
                {design.thumbnailUrl ? (
                  <img
                    src={design.thumbnailUrl}
                    alt="Thumbnail"
                    className="w-full h-40 object-contain rounded mb-2 bg-gray-100"
                  />
                ) : (
                  <div className="w-full h-40 bg-gray-200 flex items-center justify-center mb-2 rounded text-gray-400 text-sm">
                    No thumbnail
                  </div>
                )}
                <div className="w-full font-semibold text-center truncate">{design.title || 'Untitled Design'}</div>
              </div>
            ))}
          </div>
        )}

        {designs.length > visibleDesigns.length && (
          <div className="flex justify-center mt-8">
            <button className="px-6 py-2 bg-indigo-100 text-indigo-700 rounded font-semibold hover:bg-indigo-200">
              See more
            </button>
          </div>
        )}
      </div>
    </div>
  );
};

export default Dashboard;
